{"path":"~/ctf_files/feather.cpp","contents":"#include <fstream>
#include <unordered_map>
#include <iostream>

#define MAGIC 0x0AB0BEEF

using namespace std;

int main(int argc, char** argv) {
	if (argc != 3) {
		cerr << "Usage: " << argv[0] << " <input_file> <output_file>" << endl;
		return 1;
	}

	ifstream input(argv[1]);
	ofstream output(argv[2]);

	if (!input || !output) {
		cerr << "Error opening files" << endl;
		return 2;
	}

	unordered_map<uint32_t, string> file_data;

	// Read input file and store data
	string file_content;
	while (getline(input, file_content)) {
		uint32_t file_id = file_content.size();
		file_data[file_id] = file_content;
	}

	// Write magic number
	output.write(reinterpret_cast<const char*>(&MAGIC), sizeof(MAGIC));

	// Write number of files
	uint32_t num_files = file_data.size();
	output.write(reinterpret_cast<const char*>(&num_files), sizeof(num_files));

	// Write file data
	for (const auto& entry : file_data) {
		uint32_t file_id = entry.first;
		uint32_t file_size = entry.second.size();
		output.write(reinterpret_cast<const char*>(&file_id), sizeof(file_id));
		output.write(reinterpret_cast<const char*>(&file_size), sizeof(file_size));
		output.write(entry.second.data(), file_size);
	}

	// Close files
	input.close();
	output.close();

	return 0;
}
"}

